(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0b2e6c"],{"25a4":function(e){e.exports=JSON.parse('{"name":"Depth-first Search","description":"The strategy followed by depth-first search is, as its name implies, to search \\"deeper\\" in the graph whenever possible. Depth-first search explores edges out of the most recently discovered vertexv that still has unexplored edges leaving it.Once all of v\'s edges have been explored, the search \\"backtracks\\" to explore edges leaving the vertex from which v was discovered. This process continues until we have discovered all the vertices that are reachable from the original source vertex.","items":[{"tags":[{"name":"data structures","url":"/tags/data-structures"},{"name":"dfs","url":"/tags/dfs"}],"title":"CF-383C Propagating tree","excerpt":"Iahub likes trees very much. Recently he discovered an interesting tree named propagating tree. The tree consists of $n$ nodes numbered from $1$ to $n$ , each node $i$ having an initial value $a_{i}$. The root of the tree is node $1$.","updated_at":"2022-01-26T22:45:21+08:00","created_at":"2022-01-26T22:45:21+08:00","url":"/docs/data-structures/segment-tree/cf-383c"},{"tags":[{"name":"dfs","url":"/tags/dfs"}],"title":"洛谷P1120 小木棍","excerpt":"乔治有一些同样长的小木棍，他把这些木棍随意砍成几段，使得每段的长都不超过50。现在，他想把小木棍拼接成原来的样子，但是却忘记了自己开始时有多少根木棍和它们的长度。给出每段小木棍的长度，编程帮他找出原始木棍的最小可能长度。","updated_at":"2022-01-26T22:45:21+08:00","created_at":"2022-01-26T22:45:21+08:00","url":"/docs/acm/search/luogu-1120"},{"tags":[{"name":"dfs","url":"/tags/dfs"}],"title":"洛谷P5194 [USACO05DEC] Scales S","excerpt":"约翰有一架用来称牛的体重的天平。与之配套的是 $N$ ( $1 \\\\leq N \\\\leq 1000$ )个已知质量的砝码（所有砝码质量的数值都在32位带符号整数范围内）。","updated_at":"2022-01-26T22:45:21+08:00","created_at":"2022-01-26T22:45:21+08:00","url":"/docs/acm/search/luogu-5194"},{"tags":[{"name":"dfs","url":"/tags/dfs"},{"name":"dp","url":"/tags/dp"}],"title":"洛谷P3052 [USACO12MAR] Cows in a Skyscraper G","excerpt":"A little known fact about Bessie and friends is that they love stair climbing races. A better known fact is that cows really don\'t like going down stairs. So after the cows finish racing to the top of their favorite skyscraper, they had a problem. Refusing to climb back down using the stairs, the cows are forced to use the elevator in order to get back to the ground floor.","updated_at":"2022-01-26T22:45:21+08:00","created_at":"2022-01-26T22:45:21+08:00","url":"/docs/acm/search/luogu-3052"}],"url":"/tags/dfs"}')}}]);
